import { Link, useParams } from "react-router-dom";
import { useEffect, useState } from "react";

import CategoryService from "../../services/category.service";

export const CategortOffersList = () => {
  const params = useParams();
  const [category, setCategory] = useState([]);
  const [offers, setOffers] = useEffect([]);

  useEffect(() => {
    CategoryService.getCategoryById(params.id).then((category) =>
      setCategory(category.data)
    );
    setOffers(category.offers);
  }, []);

  //   const offers = {};

  //   category.offers.forEach((element) => {
  //     offers.push(element);
  //   });

  return (
    <div class="category-offer-list">
      <div class="container mt-100">
        <div class="offer_list col-8">
          <div class="list-group" id="list-tab" role="tablist">
            <a
              class="list-group-item list-group-item-action"
              id="list-profile-list"
              data-toggle="list"
              href="#list-profile"
              role="tab"
              aria-controls="profile"
            >
              Profile
            </a>
            <a
              class="list-group-item list-group-item-action"
              id="list-messages-list"
              data-toggle="list"
              href="#list-messages"
              role="tab"
              aria-controls="messages"
            >
              Messages
            </a>
            <a
              class="list-group-item list-group-item-action"
              id="list-settings-list"
              data-toggle="list"
              href="#list-settings"
              role="tab"
              aria-controls="settings"
            >
              Settings
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};
